// src/pages/Resources.jsx
import React from 'react';
import { BookOpen, Video, FileText, Users, Download, Calendar } from 'lucide-react';
import Footer from '../components/Footer';

const Resources = () => {
  const resources = [
    {
      category: 'Documentation',
      icon: <FileText className="w-8 h-8" />,
      items: [
        { title: 'Getting Started Guide', description: 'Step-by-step setup instructions', link: '/docs/getting-started' },
        { title: 'API Reference', description: 'Complete API documentation', link: '/docs/api' },
        { title: 'Admin Manual', description: 'Administrator guide', link: '/docs/admin' },
        { title: 'Developer Guide', description: 'Integration tutorials', link: '/docs/developer' }
      ]
    },
    {
      category: 'Learning',
      icon: <Video className="w-8 h-8" />,
      items: [
        { title: 'Video Tutorials', description: 'Step-by-step video guides', link: '/learn/videos' },
        { title: 'Webinars', description: 'Live training sessions', link: '/learn/webinars' },
        { title: 'Online Courses', description: 'Structured learning paths', link: '/learn/courses' },
        { title: 'Best Practices', description: 'Industry best practices', link: '/learn/best-practices' }
      ]
    },
    {
      category: 'Community',
      icon: <Users className="w-8 h-8" />,
      items: [
        { title: 'Community Forum', description: 'Connect with other users', link: '/community/forum' },
        { title: 'User Groups', description: 'Local meetups and groups', link: '/community/groups' },
        { title: 'Success Stories', description: 'Customer case studies', link: '/community/stories' },
        { title: 'Contributor Program', description: 'Contribute to our platform', link: '/community/contribute' }
      ]
    }
  ];

  const downloads = [
    { title: 'White Paper: AI in Education', icon: <Download />, size: '2.4 MB' },
    { title: 'Case Study: Stanford University', icon: <Download />, size: '1.8 MB' },
    { title: 'API Cheat Sheet', icon: <Download />, size: '1.2 MB' },
    { title: 'Security Overview', icon: <Download />, size: '3.1 MB' }
  ];

  return (
    <div className="min-h-screen bg-gradient-to-b from-gray-900 to-black text-white">
      {/* Hero Section */}
      <section className="pt-32 pb-20">
        <div className="container mx-auto px-6 text-center">
          <h1 className="text-5xl md:text-7xl font-bold mb-6">
            Resources &{' '}
            <span className="bg-gradient-to-r from-cyan-400 to-purple-400 bg-clip-text text-transparent">
              Documentation
            </span>
          </h1>
          
          <p className="text-xl text-gray-300 max-w-3xl mx-auto mb-12">
            Everything you need to get started, learn, and master SkyReti Educore.
          </p>
        </div>
      </section>

      {/* Main Resources */}
      <section className="py-20">
        <div className="container mx-auto px-6">
          <div className="grid md:grid-cols-3 gap-8 mb-20">
            {resources.map((resource, idx) => (
              <div key={idx} className="bg-gradient-to-b from-gray-800/50 to-gray-900/30 p-8 rounded-3xl border border-gray-700">
                <div className="flex items-center mb-6">
                  <div className="w-14 h-14 bg-gradient-to-r from-cyan-500 to-blue-600 rounded-xl flex items-center justify-center mr-4">
                    <div className="text-white">{resource.icon}</div>
                  </div>
                  <h3 className="text-2xl font-bold">{resource.category}</h3>
                </div>
                
                <div className="space-y-4">
                  {resource.items.map((item, i) => (
                    <a
                      key={i}
                      href={item.link}
                      className="block p-4 bg-gray-800/30 rounded-xl hover:bg-gray-700/50 transition-colors"
                    >
                      <div className="font-bold mb-1">{item.title}</div>
                      <div className="text-gray-400 text-sm">{item.description}</div>
                    </a>
                  ))}
                </div>
              </div>
            ))}
          </div>

          {/* Downloads Section */}
          <div className="mb-20">
            <h2 className="text-4xl font-bold text-center mb-12">Downloads</h2>
            <div className="grid md:grid-cols-2 lg:grid-cols-4 gap-6">
              {downloads.map((download, idx) => (
                <div key={idx} className="bg-gray-800/20 p-6 rounded-2xl border border-gray-700">
                  <div className="flex items-center justify-between mb-4">
                    <div className="text-cyan-400">{download.icon}</div>
                    <span className="text-gray-500 text-sm">{download.size}</span>
                  </div>
                  <h4 className="font-bold text-lg mb-2">{download.title}</h4>
                  <button className="text-cyan-400 hover:text-cyan-300 text-sm font-medium">
                    Download PDF
                  </button>
                </div>
              ))}
            </div>
          </div>

          {/* Upcoming Events */}
          <div className="bg-gradient-to-r from-gray-800/30 to-gray-900/30 rounded-3xl p-12">
            <div className="flex items-center justify-between mb-8">
              <div>
                <h2 className="text-4xl font-bold mb-2">Upcoming Events</h2>
                <p className="text-gray-400">Join our live sessions and webinars</p>
              </div>
              <Calendar className="w-12 h-12 text-cyan-400" />
            </div>
            
            <div className="space-y-4">
              {[
                { title: 'AI in Education Webinar', date: 'Jan 15, 2025', time: '2:00 PM EST' },
                { title: 'Advanced Analytics Workshop', date: 'Jan 22, 2025', time: '11:00 AM EST' },
                { title: 'Q1 Product Launch', date: 'Feb 5, 2025', time: '3:00 PM EST' }
              ].map((event, idx) => (
                <div key={idx} className="flex items-center justify-between p-4 bg-gray-800/50 rounded-xl">
                  <div>
                    <div className="font-bold">{event.title}</div>
                    <div className="text-gray-400 text-sm">
                      {event.date} â€¢ {event.time}
                    </div>
                  </div>
                  <button className="bg-cyan-600 hover:bg-cyan-700 px-4 py-2 rounded-lg">
                    Register
                  </button>
                </div>
              ))}
            </div>
          </div>
        </div>
      </section>

      {/* CTA */}
      <section className="py-20 text-center">
        <div className="container mx-auto px-6">
          <h2 className="text-4xl font-bold mb-6">Need Help Getting Started?</h2>
          <p className="text-gray-400 text-xl mb-10 max-w-2xl mx-auto">
            Our support team is here to help you succeed.
          </p>
          <div className="flex flex-col md:flex-row gap-4 justify-center">
            <button 
              onClick={() => window.location.href = '/contact'}
              className="bg-gradient-to-r from-cyan-500 to-blue-600 hover:from-cyan-600 hover:to-blue-700 px-10 py-5 rounded-2xl text-xl font-bold"
            >
              Contact Support
            </button>
            <button 
              onClick={() => window.location.href = '/docs'}
              className="bg-gray-800 hover:bg-gray-700 border border-gray-700 px-10 py-5 rounded-2xl text-xl font-bold"
            >
              View Documentation
            </button>
          </div>
        </div>
      </section>

      <Footer />
    </div>
  );
};

export default Resources;
